"255 :     private Map<String, String> computeVarList(
256 :         Var v, ReferenceCollection referenceInfo) {
257 :       Map<String, String> varmap = Maps.newLinkedHashMap();
258 : 
259 :       for (Reference ref : referenceInfo.references) {
260 :         if (ref.isLvalue() || ref.isInitializingDeclaration()) {
261 :           Node val = ref.getAssignedValue();
262 :           if (val != null) {
263 :             Preconditions.checkState(val.isObjectLit());
264 :             for (Node child = val.getFirstChild(); child != null;
265 :                  child = child.getNext()) {
266 :               String varname = child.getString();
267 :               if (varmap.containsKey(varname)) {
268 :                 continue;
269 :               }
270 : 
271 :               String var = VAR_PREFIX + varname + "_" +
272 :                 safeNameIdSupplier.get();
273 :               varmap.put(varname, var);
274 :             }
275 :           }
276 :         } else if (ref.getParent().isVar()) {
277 :           // This is the var. There is no value.
278 :         } else {
279 :           Node getprop = ref.getParent();
280 :           Preconditions.checkState(getprop.isGetProp());
281 : 
282 :           // The key being looked up in the original map.
283 :           String varname = getprop.getLastChild().getString();
284 :           if (varmap.containsKey(varname)) {
285 :             continue;
286 :           }
287 : 
288 :           String var = VAR_PREFIX + varname + "_" + safeNameIdSupplier.get();
289 :           varmap.put(varname, var);
290 :         }
291 :       }
292 : 
293 :       return varmap;
294 :     }"

"315 :     private void replaceAssignmentExpression(Var v, Reference ref,
316 :                                              Map<String, String> varmap) {
317 :       // Compute all of the assignments necessary
318 :       List<Node> nodes = Lists.newArrayList();
319 :       Node val = ref.getAssignedValue();
320 :       blacklistVarReferencesInTree(val, v.scope);
321 :       Preconditions.checkState(val.isObjectLit());
322 :       Set<String> all = Sets.newLinkedHashSet(varmap.keySet());
323 :       for (Node key = val.getFirstChild(); key != null;
324 :            key = key.getNext()) {
325 :         String var = key.getString();
326 :         Node value = key.removeFirstChild();
327 :         // TODO(user): Copy type information.
328 :         nodes.add(
329 :             IR.assign(
330 :                 IR.name(varmap.get(var)),
331 :                 value));
332 :         all.remove(var);
333 :       }
334 : 
335 :       // TODO(user): Better source information.
336 :       for (String var : all) {
337 :         nodes.add(
338 :             IR.assign(
339 :                 IR.name(varmap.get(var)),
340 :                 NodeUtil.newUndefinedNode(null)));
341 :       }
342 : 
343 :       Node replacement;
344 :       if (nodes.isEmpty()) {
345 :         replacement = IR.trueNode();
346 :       } else {
347 :         // All assignments evaluate to true, so make sure that the
348 :         // expr statement evaluates to true in case it matters.
349 :         nodes.add(IR.trueNode());
350 : 
351 :         // Join these using COMMA.  A COMMA node must have 2 children, so we
352 :         // create a tree. In the tree the first child be the COMMA to match
353 :         // the parser, otherwise tree equality tests fail.
354 :         nodes = Lists.reverse(nodes);
355 :         replacement = new Node(Token.COMMA);
356 :         Node cur = replacement;
357 :         int i;
358 :         for (i = 0; i < nodes.size() - 2; i++) {
359 :           cur.addChildToFront(nodes.get(i));
360 :           Node t = new Node(Token.COMMA);
361 :           cur.addChildToFront(t);
362 :           cur = t;
363 :         }
364 :         cur.addChildToFront(nodes.get(i));
365 :         cur.addChildToFront(nodes.get(i + 1));
366 :       }
367 : 
368 :       Node replace = ref.getParent();
369 :       replacement.copyInformationFromForTree(replace);
370 : 
371 :       if (replace.isVar()) {
372 :         replace.getParent().replaceChild(
373 :             replace, NodeUtil.newExpr(replacement));
374 :       } else {
375 :         replace.getParent().replaceChild(replace, replacement);
376 :       }
377 :     }"

